<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en-us"><head><style type="text/css"> @import url('http://www.gnu.org/software/emacs/manual.css');</style></head><body style="padding:1rem;"><strong>proced-&lt;</strong> is a compiled Lisp function in `<code>proced.el</code>'.</br>
</br>
(proced-&lt; <u>NUM1</u> <u>NUM2</u>)</br>
</br>
Return t if <u>NUM1</u> less than <u>NUM2</u>.</br>
Return `equal' if <u>NUM1</u> equals <u>NUM2</u>.  Return nil if <u>NUM1</u> greater than <u>NUM2</u>.<br/><br/><br/><br/><small>A courtesy of <a href="http://endlessparentheses.com/">Endless Parentheses</a>.</small></body></html>
